  - name: obfuscator-mutate
    inputs:
      parameters:
      - name: file
      - name : parent
    steps:
    - - name: select-oracle
        template: select-oracle-template
        arguments:
          parameters:
          - name: oracle
            value: "{{ item.oracle }}"
          - name: seed
            value: "{{ item.seed }}"
          - name: file
            value: "{{ inputs.parameters.file }}"
          - name: parent
            value: "{{ inputs.parameters.parent }}"
        withItems:
          - { oracle: 'precheck', seed: 139 }



            #
          #
          #
          #
          # Add the others here

  - name: select-oracle-template
    inputs:
      parameters:
      - name: oracle
      - name: file
      - name: parent
      - name: seed
    steps:
    - - name: execute-analyzer
        template: analyzer-template
        arguments:
          parameters:
          - name: oracle
            value: "{{ inputs.parameters.oracle }}"
          - name: seed
            value: "{{ inputs.parameters.seed }}"
          - name: features
            value: "{{item.features}}"
          - name: file
            value: "{{ inputs.parameters.file }}"
          - name: parent
            value: "{{ inputs.parameters.parent }}"
          - name: dbconn
            value: "{{item.dbconn}}"
        withItems:
          - { dbconn: "all", features: "wasm-mutate/all" }
        continueOn:
          failed: true
  - name: analyzer-template
    sidecars:
    - name: vt-oracle
      image: jacarte/vt_selenium:d5f3e8f
      args:
      - web
      env:
      - name: WEB_USER
        value: "vt"
      - name: WEB_PASS
        value: "vt123"
      - name: NO_WORKERS
        value: "12"
      - name: MC_ENDPOINT
        value: "exp"
      - name: MC_BUCKET
        value: "my-bucket"
      - name: MINIO_HOST
        value: "http://minio-service.minio:3434"
      - name: MINIO_PASS
        value: "minio123"
      - name: MINIO_USER
        value: "minio"
      - name: TH
        value: "52"
      - name: MC_FILES
        value: "vt-api-files-v6"
      command: ["/bin/bash", "/vt_oracle/entrypoint.sh", "web"]
      mirrorVolumeMounts: true
    volumes:
    - name: data
      emptyDir: {}
    activeDeadlineSeconds: 36000
    retryStrategy:
      limit: 8
    inputs:

      parameters:
      - name: oracle
      - name: dbconn
      - name: features
      - name: file
      - name: parent
      - name: seed
      artifacts:
      - name: data
        path: /input.wasm
        archive:
          none: {}
        s3:
          bucket: my-bucket
          endpoint: minio-service.minio:3434
          insecure: true
          # Avoid to mount the full metas_filtered folder in the container
          key: "from_minos/{{inputs.parameters.parent}}/{{inputs.parameters.file}}"
          accessKeySecret:
            name: argo-artifacts
            key: accesskey
          secretKeySecret:
            name: argo-artifacts
            key: secretkey

    script:
      image: jacarte/obf-image:ea6740d
      command: [bash]
      volumeMounts:
      - name: data
        mountPath: /vt_oracle/data
      resources:
        requests:
          memory: "0"
          cpu: 1.2
      source: |
         # Install mc client to save snapshot
          until `curl -G 'http://127.0.0.1:4000/' >& /tmp/out`; do echo sleep && sleep 1; done
          echo "Server working"

          mkdir -p $HOME/minio-binaries
          wget -O $HOME/minio-binaries/mc https://dl.min.io/client/mc/release/linux-amd64/mc
          ls
          echo "======"
          chmod +x $HOME/minio-binaries/mc
          export PATH=$PATH:$HOME/minio-binaries/

          mc config host add exp http://minio-service.minio:3434 minio minio123


          mkdir -p $HOME/minio-binaries
          wget -O $HOME/minio-binaries/mc https://dl.min.io/client/mc/release/linux-amd64/mc
          ls
          echo "======"
          chmod +x $HOME/minio-binaries/mc
          export PATH=$PATH:$HOME/minio-binaries/

          mc config host add exp http://minio-service.minio:3434 minio minio123



         # Update with latest version
         git pull
         git submodule update --recursive

         ls -R ../oracles
         pip3 install -r ../oracles/requirements.txt


         echo "Oracle {{inputs.parameters.oracle}}"
         mkdir -p datas/{{inputs.parameters.dbconn}}
         if python3 ../../oracles/vt_custom_chrome/vt_oracle_count.py http://127.0.0.1:4000 {{ inputs.parameters.oracle }} vt vt123 {{ inputs.parameters.file }} /input.wasm
         then
          touch /{{ inputs.parameters.dbconn }}.stats.txt
          echo "Still VT detected"
          echo "0" >  /{{inputs.parameters.file}}.no.stats.txt
          mc cp /result.csv exp/my-bucket/vt_checked3/{{inputs.parameters.parent}}/detected/{{inputs.parameters.file}}.csv
         else
          echo "No VT detected"
          touch /{{ inputs.parameters.file }}.stats.txt
          mc cp /result.csv exp/my-bucket/vt_checked3/{{inputs.parameters.parent}}/bypass/{{inputs.parameters.file}}.csv
         fi

